function showAlertDangQuay() {
    try {
        let t = '';
        switch (xoso.RunningQuayThuVietlott) {
            case 3:
                t = 'x s Mega 6/45';
                break;
            case 1:
                t = 'x s Power 6/55';
                break;
            case 2:
                t = 'x s Max4D';
        }
        if (t.length) {
            let e = 'ang quay th ' + t;
            toastr.warning(e);
        }
    } catch (t) {}
}
